import React from 'react'
import { NavLink } from 'react-router-dom'
import styles from './Header.module.css'

const Header = () => {
  return (
    <nav>
      <NavLink to="/" end>Produto</NavLink>
      <NavLink to="contato" end>Contato</NavLink>
    </nav>
  )
}

export default Header
